import styled from "styled-components";
export {imageBg} from '../images/'

export const HeroContainer = styled.div`
    background: linear-gradient(to right, rgba(0,0,0,0.7),
    rgba(0,0,0,0.1)), 
    url()(${imageBg});
    height:100vh;
    background-position:center;
    background
`
